import logo from './logo.svg';
import './App.css';
import './telas/jogos';
import 'react-dom';
import { Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h3>Bingo do Medo</h3>
        </header>
        <Switch>
            <Route path="/" element={<home />} />
            <Route path="/jogo" element={<jogos />} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
